import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import express from "express";

const app = express(); 
const PORT=3004;

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

app.listen(PORT,() => {
  console.log(`Server listen at port ${PORT}`);
